import React from "react";

function NavBar() {
  return (
    <div className="bg-[#F3F4F6] h-[5em]">
      <div className="flex flex-row justify-between items-center ml-10">
        <div className="text-[#16174F] text-xl text-center justify-center font-normal">
          Parshav Holdings
        </div>
      </div>
    </div>
  );
}

export default NavBar;
